  return (
    <div className="text-center">
      <div style={{"maxWidth":"50%"}}>
      <img className="img-fluid" src="https://live.staticflickr.com/65535/52545146582_60f93b6739_b.jpg" alt="Captura de Pantalla 2022-12-05 a la(s) 7.51.21 p.m."></img>
        <img className="img-fluid" src="https://live.staticflickr.com/65535/52545146487_a0845d5cfc_b.jpg" alt="Captura de Pantalla 2022-12-05 a la(s) 7.51.45 p.m."></img>
        <img className="img-fluid" src="https://live.staticflickr.com/65535/52545906289_0b637e053a_c.jpg" alt="Captura de Pantalla 2022-12-05 a la(s) 7.51.04 p.m."></img>

      </div>
       </div>
  );
}

export default GraficasVentas;
